import React from "react";
import "./styles/calendar.css";

const Calendar = () => {
  return (
    <div className="main-form" data-aos="fade-left" data-aos-offset="50" data-aos-easing="ease-in-out">
      <header className="search-bar">
        <h1>Calendar</h1>
      </header>
      <main className="body-content">
        <div className="form-section">
          <h2>Default Form</h2>
          <p>Welcome to the universal form!</p>
        </div>
      </main>
    </div>
  );
};

export default Calendar;
